    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Muleshoe and Grulla NWRs for the next 15 years.
    This plan outlines the refuges' vision and purpose and describes how Muleshoe and
    Grulla NWRs will contribute to the overall mission of the Refuge System. The plan
    provides an introduction to the refuges, an overview of the CCP process, a summary
    of refuge resources, information about the management direction, strategies for
    implementation, and administration. Key planning issues include: private lands,
    water management, environmental education, resource information, wildlife depredation,
    grassland management, and funding.",nt"license_title": "License Not Specified",nt"extras":
